@import 'circles.scss';
@import 'triangles.scss';
@import 'squares.scss';

$font-color: #fff;
$background-color: #f5f5f5;
$profile-font: 'Work Sans', sans-serif;
@import 'variables.scss';

* {
  padding: 0;
  margin: 0;
}

body {
  background-color: $background-color;
  position: relative;
}

.form {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, 30%);
  background-color: $text-field-bg;
  font-family: $profile-font;
  width: 80%;
  margin: auto;
  display: flex;
  flex-direction: column;
  padding: 15px;
  border-radius: 20px;

  &__label {
    text-align: center;
    display: flex;
    flex-direction: column;
    width: 80%;
    margin: 0 auto;
    padding: 5px 0px;
    margin-bottom: 10px;
  }

  &__label span {
    font-size: 28px;
    color: $font-color;
    padding: 6px;
    font-weight: 500;
  }

  &__label input {
    padding: 10px;
    font-size: 16px;
  }

  &__label textarea {
    padding: 20px;
    font-size: 16px;
  }

  &__button {
    background-color: $button-color;
    border: $button-color;
    padding: 10px 40px;
    border-radius: 10px;
    font-weight: bold;
    color: $text-field-bg;
    font-size: 20px;
  }

  p {
    text-align: center;
  }
}

.footer {
  position: absolute;
  display: flex;
  font-family: $profile-font;
  margin: 0 auto;
  padding-top: 20px;
  width: 100%;
  margin-bottom: 0px;
  justify-content: center;

  &__link {
    background-color: $text-field-bg;
    border-radius: 10px;
    width: 140px;
    padding: 4px;
    font-size: 22px;
    font-weight: 600;
    color: $font-color;
    list-style: none;
    text-align: center;
    text-decoration: none;
    margin: 5px;
    cursor: pointer;
  }
}

@media (min-width: 768px) {
  .form {
    width: 500px;

    &__label {
      width: 80%;
      margin: 0 auto;
      padding: 5px 0px;
      margin-bottom: 20px;
    }

    &__label span {
      font-size: 48px;
      padding: 10px;
      font-weight: 500;
    }

    &__label input {
      padding: 20px;
      font-size: 24px;
    }

    &__button {
      padding: 20px 60px;
      border-radius: 10px;
      font-weight: bold;
      font-size: 20px;
    }

    &__label textarea {
      padding: 60px;
    }
  }

  .footer {
    padding-top: 60px;
    width: 100%;

    &__link {
      border-radius: 10px;
      width: 220px;
      padding: 4px;
      font-size: 36px;
      margin: 25px;
    }
  }
}

@media (min-width: 1024px) {
  .form {
    width: 700px;

    &__label {
      width: 80%;
      margin: 0 auto;
      padding: 5px 0px;
      margin-bottom: 35px;
    }

    &__label span {
      font-size: 58px;
      padding: 15px 5px;
      border-radius: 5px;
      font-weight: 500;
    }

    &__label input {
      padding: 30px;
      font-size: 36px;
    }

    &__button {
      padding: 30px 80px;
      border-radius: 10px;
      font-weight: bold;
      font-size: 36px;
    }

    &__label textarea {
      padding: 60px;
      font-size: 26px;
    }
  }

  .footer {
    padding-top: 140px;
    width: 100%;

    &__link {
      background-color: $text-field-bg;
      border-radius: 10px;
      width: 330px;
      padding: 6px;
      font-size: 46px;
      margin: 0px 20px;
    }
  }
}

@media (min-width: 1200px) {
  .form {
    width: 400px;
    padding: 5px;

    &__label {
      width: 80%;
      margin: 0 auto;
      padding: 5px 0px;
      margin-bottom: 15px;
    }

    &__label span {
      font-size: 32px;
      padding: 10px 5px;
      font-weight: 500;
    }

    &__label input {
      padding: 15px;
      font-size: 16px;
    }

    &__button {
      padding: 10px 60px;
      border-radius: 10px;
      font-weight: bold;
      font-size: 24px;
      margin-bottom: 10px;
    }

    &__label textarea {
      padding: 20px;
      font-size: 16px;
    }
  }

  .footer {
    padding-top: 40px;
